import React from 'react';
import UserTableRow from 'C:/Test_Task/test-react-app/src/components/UserTableRow';

const UserTable = ({ users, onDelete }) => {
  return (
    <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Email</th>
          <th>Action</th>
        </tr>
      </thead>
      <tbody>
        {users.map((user) => (
          <UserTableRow key={user.id} user={user} onDelete={onDelete} />
        ))}
      </tbody>
    </table>
  );
};

export default UserTable;
